const wrappedDom = `<body>${dom}</body>`;

// Parse the string into a DOM object
const parser = new JSDOM(wrappedDom);

// Access the first `<a>` element
const firstAnchor = Array.from(parser.window.document.querySelectorAll('a'));

const scimObj = {}
let count = 0;

( async function (){
    apps = await dbConn.query(getQuery)
    const appsList = new Set()
    apps.map((app) => {
        appsList.add(app.name) ;
    })
    console.log(appsList)
    firstAnchor.map((anchor) => {
        if(!appsList.has(anchor.textContent))
            scimObj[anchor.textContent] = anchor.href
    })

    generateQuery(scimObj);


})()

function generateQuery(appList) {

    const insertQuery = "INSERT INTO `integration_application` (`integration_app_id`, `integration_app_display_name`, `icon_url`, `integration_category`, `AppOrder`, `redirect_url`) VALUES ("
    const queryList = []
   for(let i in appList) {
    queryList.push(insertQuery + `'${uuidv4()}','${i}','./assets/favicon/MicrosoftScimProvisioning/','SCIMMicrosoft','0','${appList[i]}');`)
   }
   const fileContent = queryList.join('\n');
   fs.writeFile('newScimQueryList',fileContent, (err) => {
    if(err)
        console.log('Failed to generate file , ',err)
    else 
        console.log('done')
   })
}


